import React, { Component } from "react";
import { TopicWrapper, TopicItem } from "../style";

class Topic extends Component {
  render() {
    return (
      <TopicWrapper>
        <TopicItem>1</TopicItem>
      </TopicWrapper>
    );
  }
}

export default Topic;
